import React from 'react';
import { Link } from 'react-router-dom';
import { FaUser } from 'react-icons/fa';

const Header = () => {
  return (
    <div className='flex gap-10 justify-between items-center text-black fixed top-0 w-full z-50 p-4' style={{ backgroundColor: 'rgba(20, 25, 31, 0.8)' }}>
      <div className='text-xl font-bold text-white'>
        <h1>E-Commerce Project</h1>
      </div>
      <div className='flex space-x-4'>
        <Link to='/home' className='text-white px-3 py-1 rounded transition duration-300 hover:bg-orange-600'>Home</Link>
        <Link to='/about' className='text-white px-3 py-1 rounded transition duration-300 hover:bg-orange-600'>About</Link>
        <Link to='/list' className='text-white px-3 py-1 rounded transition duration-300 hover:bg-orange-600'>Program List</Link>
        <Link to='' className='text-white px-3 py-1 rounded transition duration-300 hover:bg-orange-600'>Community</Link>
        <Link to='/contact' className='text-white px-3 py-1 rounded transition duration-300 hover:bg-orange-600'>Contact</Link>
      </div>
      <div className="flex items-center space-x-4">
        <Link to="/login" className=" text-white px-5 py-2 rounded-md flex items-center space-x-2 hover:bg-orange-600 transition duration-300">
          <FaUser className="w-5 h-5" />
          <span>Login</span>
        </Link>
        <Link to="/signup" className=" text-white px-5 py-2 rounded-md hover:bg-orange-600 transition duration-300">
          Sign Up
        </Link>
      </div>
    </div>
  );
}

export default Header;
